import React, { useState } from 'react'
import './Navbar.css'
import logo from '../Assets/No-back-logo.svg'
import ShoppingCart2LineIcon from 'remixicon-react/ShoppingCart2LineIcon';
import { Link } from 'react-router-dom';
export const Navbar = () => {

    const [menu,setMenu] = useState("shop");

  return (
<div className='navbar'>
  <div className='nav-logo'>
    <img src={logo} alt="" className='navbar-logo'/>
    <p>AI.ART</p>
  </div>
  <ul className='nav-menu'>
   
  </ul>
  <div className='nav-login-cart'>
    <button>Login</button>
      {/* The default color is the current text color (currentColor) */}
      <ShoppingCart2LineIcon className='cart-icon' />
      <div className='nav-cart-count'>0</div>
  </div>
</div>
  )
}
